import React from 'react';
import ReactDOM from 'react-dom';
import Heading from './Heading';
import Paragraph from './Paragraph';

ReactDOM.render(
  <>
    <Heading/>
    <Paragraph/>
    <ol>
      <li>Aayush</li>
      <li>Ram</li>
      <li>Prajaal</li>
      <li>Sushil</li>
    </ol>
  </>
  ,document.getElementById('root')
);
